import React from "react";

function Header() {
  return (
      <header className='App-header'>
        <div className="image">
        <img src='https://www.hadalsame.com/wp-content/uploads/2022/04/S-123.jpg'></img>
      </div>  
        <div>
      <h1>SMART STUDENT</h1>
      </div>
      </header>
  );
}

export default Header;
